css:
atom-ternjs-reference > div > div,
atom-ternjs-rename > div > div {
  max-height: 180px;
  overflow-y: auto;
}
atom-ternjs-rename > div {
  padding: 0 0 20px 20px;
}
atom-ternjs-rename atom-text-editor {
  max-width: 30%;
}
atom-ternjs-rename .mt {
  margin-top: 10px;
}
atom-ternjs-reference > div,
atom-ternjs-rename > div,
atom-ternjs-config > div {
  position: relative;
}
atom-ternjs-reference > div > div {
  padding: 0 20px 20px;
}
atom-ternjs-reference ul {
  list-style: none;
  padding-left: 0;
}
atom-ternjs-reference li {
  cursor: pointer;
  padding: 6px 0;
}
atom-ternjs-reference li:hover {
  background: rgba(100, 100, 100, 0.3);
}
atom-ternjs-reference h3 {
  margin: 0;
}
atom-ternjs-reference h3 > span {
  display: block;
  float: left;
}
atom-ternjs-reference h3 > span:first-child {
  width: 70%;
}
atom-ternjs-reference h3 > span:nth-child(2) {
  width: 30%;
  text-align: right;
}
atom-ternjs-reference .clear {
  clear: left;
}
atom-ternjs-reference strong {
  color: #6494ed;
}
atom-ternjs-reference .darken {
  color: #60798a;
}
.atom-ternjs-documentation,
.atom-ternjs-type {
  max-width: 1000px;
  background: #193549;
  color: #d5dce2;
  border-radius: 3px;
}
.atom-ternjs-documentation h3,
.atom-ternjs-type h3,
.atom-ternjs-documentation p,
.atom-ternjs-type p,
.atom-ternjs-documentation a,
.atom-ternjs-type a {
  word-break: break-word;
}
.atom-ternjs-documentation {
  border: 10px solid #0f202c;
}
.atom-ternjs-type {
  border: 1px solid #0f202c;
}
atom-ternjs-type > div,
atom-ternjs-documentation > div {
  max-height: calc(33.33333333vh);
  overflow-y: auto;
}
atom-ternjs-documentation > div:not(:empty),
atom-ternjs-type > div:not(:empty) {
  padding: 5px 20px;
}
atom-ternjs-type {
  color: #99abb8;
}
atom-ternjs-type .doc-param-first,
atom-ternjs-type .storage.type {
  display: inline-block;
}
atom-ternjs-type .doc-param-first,
atom-ternjs-type .doc-return {
  margin-top: 10px;
}
atom-ternjs-type .current-param {
  font-weight: 500;
}
atom-text-editor .scroll-view .syntax-- .source.syntax--js .function:not(.meta):not(.type).atom-ternjs-hover,
atom-text-editor .scroll-view .syntax-- .source.syntax--js .class .name.atom-ternjs-hover,
atom-text-editor .scroll-view .syntax-- .source.syntax--js .support.atom-ternjs-hover,
atom-text-editor .scroll-view .syntax-- .source.syntax--js .constant.other.atom-ternjs-hover,
atom-text-editor .scroll-view .syntax-- .source.syntax--js .object:not(.delimiter).atom-ternjs-hover,
atom-text-editor .scroll-view .syntax-- .source.syntax--js .variable.atom-ternjs-hover {
  border-bottom: 1px solid #ad7c0b;
}
/* Atom < 1.13 */
atom-text-editor::shadow .scroll-view .source.js .function:not(.meta):not(.type).atom-ternjs-hover,
atom-text-editor .scroll-view .source.js .function:not(.meta):not(.type).atom-ternjs-hover,
atom-text-editor::shadow .scroll-view .source.js .class.name.atom-ternjs-hover,
atom-text-editor .scroll-view .source.js .class.name.atom-ternjs-hover,
atom-text-editor::shadow .scroll-view .source.js .support.atom-ternjs-hover,
atom-text-editor .scroll-view .source.js .support.atom-ternjs-hover,
atom-text-editor::shadow .scroll-view .source.js .constant.other.atom-ternjs-hover,
atom-text-editor .scroll-view .source.js .constant.other.atom-ternjs-hover,
atom-text-editor::shadow .scroll-view .source.js .object:not(.delimiter).atom-ternjs-hover,
atom-text-editor .scroll-view .source.js .object:not(.delimiter).atom-ternjs-hover,
atom-text-editor::shadow .scroll-view .source.js .variable.atom-ternjs-hover,
atom-text-editor .scroll-view .source.js .variable.atom-ternjs-hover {
  border-bottom: 1px solid #ad7c0b;
}
/* Atom >= 1.13 */
atom-text-editor .scroll-view .syntax--source.syntax--js .syntax--function:not(.meta):not(.type).atom-ternjs-hover,
atom-text-editor .scroll-view .syntax--source.syntax--js .syntax--class.syntax--name.atom-ternjs-hover,
atom-text-editor .scroll-view .syntax--source.syntax--js .syntax--support.atom-ternjs-hover,
atom-text-editor .scroll-view .syntax--source.syntax--js .syntax--constant.syntax--other.atom-ternjs-hover,
atom-text-editor .scroll-view .syntax--source.syntax--js .syntax--object:not(.syntax--delimiter).atom-ternjs-hover,
atom-text-editor .scroll-view .syntax--source.syntax--js .syntax--variable.atom-ternjs-hover {
  border-bottom: 1px solid #ad7c0b;
}
/* Atom >= 1.13 */
atom-text-editor[data-grammar="source js"] .atom-ternjs-definition-marker div,
atom-text-editor[data-grammar="source js"]::shadow .atom-ternjs-definition-marker div {
  transition: opacity 0.75s ease;
  opacity: 0;
  background: #234b67;
  border-bottom: 4px solid #ad7c0b;
}
atom-text-editor[data-grammar="source js"] .atom-ternjs-definition-marker.active div,
atom-text-editor[data-grammar="source js"]::shadow .atom-ternjs-definition-marker.active div {
  opacity: 1;
}
.atom-ternjs-reference-close,
.atom-ternjs-rename-close {
  margin: 20px;
  position: absolute;
  right: 0;
  top: 0;
}
.atom-ternjs-config-close {
  margin: 20px 0 60px;
}
.atom-ternjs-config-panel {
  max-width: 1000px;
  overflow-y: auto;
  padding: 20px;
}
.atom-ternjs-config h1 {
  margin-bottom: 30px;
}
.atom-ternjs-config .content > h2 {
  width: 100%;
  text-align: center;
}
.atom-ternjs-config section {
  padding-bottom: 20px;
}
.atom-ternjs-config atom-text-editor {
  width: calc(100% - 60px);
}
.atom-ternjs-config button + button {
  margin-left: 10px;
}
.atom-ternjs-config .add,
.atom-ternjs-config .sub {
  cursor: pointer;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
}
.atom-ternjs-config .add {
  right: 0;
}
.atom-ternjs-config .sub {
  right: 30px;
}
.atom-ternjs-config .input-wrapper {
  position: relative;
}
.atom-ternjs-config .input-wrapper span {
  font-size: 12px;
}
.atom-ternjs-config .input-wrapper:first-of-type .sub {
  display: none;
}
.atom-ternjs-config .input-wrapper + .input-wrapper {
  margin-top: 10px;
}
.atom-ternjs-config .libs span,
.atom-ternjs-config .ecmaVersion span,
.atom-ternjs-config .plugins span {
  margin-right: 10px;
}
.atom-ternjs-config .libs .input-wrapper,
.atom-ternjs-config .ecmaVersion .input-wrapper {
  display: inline-block;
}
.atom-ternjs-config .libs .input-wrapper + .input-wrapper,
.atom-ternjs-config .ecmaVersion .input-wrapper + .input-wrapper {
  margin-left: 20px;
}
.atom-ternjs-config .plugins .input-wrapper {
  margin-bottom: 5px;
}
.atom-ternjs-config .input-wrapper:not(:last-of-type) .add {
  display: none;
}
